import React from 'react';

export const IncomeExpenses = () => {
    return (
        <div className="inc-exp-container">
            <div>
                <h4>Income</h4>
                <p classm="money plus">+$0.00</p>
            </div>
            <div>
                <h4>Expenses</h4>
                <p class="money minus">-$0.00</p>
            </div>
        </div>
    );
}
